import "../App.css";
import { SideBarData } from "./SideBarData";

function Sidebar() {
  return (
    <div className="sideBar">
      <ul>
        {SideBarData.map((value, key) => {
          return (
            <li key={key} onClick={()=>{window.location.pathname}}>
              <div>{value.icon}</div>
              <div>{value.title}</div>
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default Sidebar;
